import React from 'react';
import {
  Card, Button, CardImg, CardTitle, CardText, CardDeck,
  CardSubtitle, CardBody
} from 'reactstrap';
import './Cards.css';

const Cards = (props) => {
  return (
    <div >
        <CardDeck className='cards'>
            <Card className='card'>
                <CardImg className='img' top  src="/images/cooking.jpg" />
                <CardBody>
                <CardTitle tag="h5">Cooking</CardTitle>
                <CardText></CardText>
                <Button color='primary'>Learn More</Button>
                </CardBody>
            </Card>
            <Card className='card'>
                <CardImg className='img' top  src="/images/finance.jpg" />
                <CardBody>
                <CardTitle tag="h5">Finance</CardTitle>
                <CardText></CardText>
                <Button color='primary'>Learn More</Button>
                </CardBody>
            </Card> 
            <Card className='card'>
                <CardImg className='img' top  src="/images/General-Knowledge.jpg" alt="Card image cap" />
                <CardBody>
                <CardTitle tag="h5">General Knowledge</CardTitle>
                <CardText></CardText>
                <Button color='primary'>Learn More</Button>
                </CardBody>
            </Card>
        </CardDeck>
    </div>
  );
};

export default Cards;
